import React, {Component} from 'react';
import './index.css';

class Home extends Component {
    constructor() {
        super();
        this.state = {};
    };

    render() {
        return(
            <>
                <div className="home">
                    <h1>
                        <span>Traveling?</span> <br/>
                        Keep your finances safe.
                    </h1>
                    <p>
                        When vacationing abroad, you are 50% more likely to lose your card or wallet. 
                        With Meta, you now have a digital wallet service with access to real card printing to 
                        create disposable burner identities when traveling abroad. Protect
                        the one that matters most to you: yours.
                    </p>
                </div>
            </>
        )
    };
}

export default Home;
